import React, { useState } from "react";
import { useTranslation } from "react-i18next";
import { useCart } from "../context/CartContext";
import { supabase } from "../lib/supabaseClient.js";
import { useNavigate } from "react-router-dom";

export default function Checkout() {
  const { t } = useTranslation();
  const { items, clear } = useCart();
  const nav = useNavigate();
  const [form, setForm] = useState({ name:"", email:"", phone:"", date:"", notes:"" });
  const [loading, setLoading] = useState(false);
  const [msg, setMsg] = useState("");

  const onSubmit = async (e) => {
    e.preventDefault();
    if (!items.length) { setMsg(t("checkout.cartEmpty")); return; }
    const first = items[0];
    setLoading(true);
    setMsg(t("checkout.creating"));
    try {
      const payload = {
        p_package_id: first.id,
        p_date: form.date || new Date().toISOString().slice(0,10),
        p_pax: first.pax || 1,
        p_audience: "domestic",
        p_customer_name: form.name,
        p_email: form.email,
        p_phone: form.phone,
        p_notes: form.notes || "",
        p_items: items.map(it => ({ item_name: it.title, qty: it.qty || 1, price_idr: it.price || 0 }))
      };
      const { data, error } = await supabase.rpc("place_order", payload);
      if (error) throw error;
      clear();
      setMsg(t("checkout.success", { code: data?.[0]?.public_code || "" }));
      nav("/");
    } catch (e2) {
      setMsg(e2.message || t("checkout.failed"));
    } finally {
      setLoading(false);
    }
  };

  return (
    <div className="container mt-6 grid md:grid-cols-2 gap-6">
      <div className="card p-4">
        <h1 className="text-2xl font-bold mb-2">{t("checkout.title")}</h1>
        <form onSubmit={onSubmit} className="grid gap-3">
          <input className="border rounded-2xl px-3 py-2 dark:bg-slate-900" placeholder={t("checkout.name")} value={form.name} onChange={e=>setForm({...form, name:e.target.value})} required />
          <input className="border rounded-2xl px-3 py-2 dark:bg-slate-900" placeholder={t("checkout.email")} type="email" value={form.email} onChange={e=>setForm({...form, email:e.target.value})} required />
          <input className="border rounded-2xl px-3 py-2 dark:bg-slate-900" placeholder={t("checkout.phone")} value={form.phone} onChange={e=>setForm({...form, phone:e.target.value})} />
          <input className="border rounded-2xl px-3 py-2 dark:bg-slate-900" placeholder={t("checkout.date")} value={form.date} onChange={e=>setForm({...form, date:e.target.value})} />
          <textarea className="border rounded-2xl px-3 py-2 dark:bg-slate-900" placeholder={t("checkout.notes")} rows="4" value={form.notes} onChange={e=>setForm({...form, notes:e.target.value})} />
          <button className="btn btn-primary" disabled={loading}>{loading ? t("checkout.processing") : t("checkout.submit")}</button>
          {msg && <p className="text-sm text-slate-500">{msg}</p>}
        </form>
      </div>
      <div className="card p-4">
        <h2 className="font-semibold mb-2">{t("checkout.summary")}</h2>
        {items.length === 0 ? <p className="text-slate-500">{t("checkout.cartEmptyShort")}</p> :
          <ul className="space-y-2">
            {items.map(it => (
              <li key={it.id} className="flex items-center justify-between">
                <span>{it.title} × {it.qty}</span>
                <span>{(it.price||0).toLocaleString("id-ID")}</span>
              </li>
            ))}
          </ul>
        }
      </div>
    </div>
  );
}
